import { FaSearch } from "react-icons/fa";
import { Link } from "react-router-dom";
import AskQuestion from "./AskQuestionBar";
import Leftbar from "./Leftbar";
import Navbar from "./Navbar";

export default function Home() {

  const sortingButtons = ['Bountied', 'Hot', 'Week', 'Month', 'Year', 'All Time'];
  return (
    <React.Fragment>
      <div className="w-7/12 h-screen bg-zinc-700">
        <div className="flex items-start justify-between pt-4 mx-4">
          <p className=" text-3xl text-white">Top Questions</p>
          <Link
            to={"/askquestion"}
            className="h-10 cursor-pointer rounded-sm bg-blue-500 p-2 text-white"
