        <div className="relative flex justify-end mt-6 mx-4">
          <button className="p-3 border-collapse border-gray-400 text-white hover:bg-slate-600 transition-all duration-100 border">Bountied</button>
          <button className="p-3 border-collapse border-gray-400 text-white hover:bg-slate-600 transition-all duration-100 border">Hot</button>
          <button className="p-3 border-collapse border-gray-400 text-white hover:bg-slate-600 transition-all duration-100 border">Week</button>
          <button className="p-3 border-collapse border-gray-400 text-white hover:bg-slate-600 transition-all duration-100 border">Month</button>
        </div>

        <div id="content">
          <p>a</p>
          <p>b</p>
          <p>c</p>
          <p>d</p>
        </div>
      </div>
    </React.Fragment>
  );
}
